import { Grid } from '@material-ui/core';
import React from 'react';

const JobRight = ({image, text}) => {
    return (
        <div>
            <Grid item xs={4} />
            <Grid item xs={2}>
                <img src={image} alt="" />
            </Grid>
            <Grid item xs={4}>
                {text}
            </Grid>
        </div>
    );
}

export default JobRight;
